men","push ups for beginners","wall push ups upside down","wall pushup","How To","weight loss","Exercise","wall push up tutorial","Push-up"],"channelId":"UCQIFLaC5ZkHvgBdPuvpgYFg","isOwnerViewing":false,"shortDescription":"WALL PUSH UPS are not only beneficial for a beginner but for all levels. They are excellent exercises for people who want to strengthen the chest, but have back problems. This is because they do not put stress on the spine.\nTo do these push –ups, please follow the steps given below:\nStand in front of a wall. Lift your arms to the shoulder level and place your palms against the wall. They should be wider than your shoulders. Your fingers must be pointing upwards. Move your feet a few feet away from the wall. Your elbows have to be bent, as you lean against the wall.\nNever arch your back during these exercises, as they can damage the spine, causing injury. Pull your stomach in and contract your buttocks during these exercises. This aids to support your upper body. Inhale before you begin the exercise and exhale as you push yourself away from the wall, until your arms are outstretched and the elbows slightly bent. Repeat this procedure 5-10 times.\nFor more advanced levels of exercise, follow the guidelines given below:\n Using a slow pace, this is a rather advanced version of the exercise. Start the doing the Wall push-up at a slow pace. While you push off from the wall, count slowly until 4. Count slowly again until 4 as you came back to the starting position. Breathing correctly during this exercise quickly enhances desired results.\nSo, go ahead and try them out. You will certainly find a marked difference after doing them.\n\nSubscribe @ https://www.youtube.com/c/Stylecrazefitness\nhttps://www.youtube.com/StylecrazeTV\nhttps://www.youtube.com/c/StylecrazeYoga\nhttps://www.youtube.com/c/Stylecrazebeauty\nFacebook @ https://www.facebook.com/StylecrazeVideos/","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/YB0egDzsu ese push –ups, please follow the steps given below:\nStand in front of a wall. Lift your arms to the shoulder level and place your palms against the wall. They should be wider than your shoulders. Your fingers must be pointing upwards. Move your feet a few feet away from the wall. Your elbows have to be bent, as you lean against the wall.\nNever arch your back during these exercises, as they can damage the spine, causing injury. Pull your stomach in and contract your buttocks during these exercises. This aids to support your upper body. Inhale before you begin the exercise and exhale as you push yourself away from the wall, until your arms are outstretched and the elbows slightly bent. Repeat this procedure 5-10 times.\nFor more advanced levels of exercise, follow the guidelines given below:\n Using a slow pace, this is a rather advanced version of the exercise. Start the doing the Wall push-up at a slow pace. While you push off from the wall, count slowly until 4. Count slowly again until 4 as you came back to the starting position. Breathing correctly during this exercise quickly enhances desired results.\nSo, go ahead and try them out. You will certainly find a marked difference after doing them.\n\nSubscribe @ https://www.youtube.com/c/Stylecrazefitness\nhttps://www.youtube.com/StylecrazeTV\nhttps://www.youtube.com/c/StylecrazeYoga\nhttps://www.youtube.com/c/Stylecrazebeauty\nFacebook @ https://www.facebook.com/StylecrazeVideos/"},"lengthSeconds":"55","ownerProfileUrl":"http://www.youtube.com/@StylecrazeFitness","externalChannelId":"UCQIFLaC5ZkHvgBdPuvpgYFg","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI","BJ","BL","BM","BN","BO","BQ","BR","BS","BT","BV","BW","BY","BZ","CA","CC","CD","CF","CG","CH","CI","CK","CL","CM","CN","CO","CR","CU","CV","CW","CX","CY","CZ","DE","DJ","DK","DM","DO","DZ","EC","EE","EG","EH","ER","ES","ET","FI","FJ","FK","FM","FO" en the chest, but have back problems. This is because they do not put stress on the spine.\nTo do these push –ups, please follow the steps given below:\nStand in front of a wall. Lift your arms to the shoulder level and place your palms against the wall. They should be wider than your shoulders. Your fingers must be pointing upwards. Move your feet a few feet away from the wall. Your elbows have to be bent, as you lean against the wall.\nNever arch your back during these exercises, as they can damage the spine, causing injury. Pull your stomach in and contract your buttocks during these exercises. This aids to support your upper body. Inhale before you begin the exercise and exhale as you push yourself away from the wall, until your arms are outstretched and the elbows slightly bent. Repeat this procedure 5-10 times.\nFor more advanced levels of exercise, follow the guidelines given below:\n Using a slow pace, this is a rather advanced version of the exercise. Start the doing the Wall push-up at a slow pace. While you push off from the wall, count slowly until 4. Count slowly again until 4 as you came back to the starting position. Breathing correctly during this exercise quickly enhances desired results.\nSo, go ahead and try them out. You will certainly find a marked difference after doing them.\n\nSubscribe @    / stylecrazefitness  \n   / stylecrazetv  \n   / stylecrazeyoga  \n   / stylecrazebeauty  \nFacebook @   / stylecrazevideos  ","commandRuns":[{"startIndex":1459,"length":24,"onTap":{"innertubeCommand":{"clickTrackingParams":"CCMQ040EGAMiEwiM9oz6i_WCAxVk2z8EHb4YAQI=","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/c/Stylecrazefitness","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/c/Stylecrazefitness","nofollow":true}}},"onTapOptions":{"accessibilityInfo":{"accessibilityLabel":"YouTube Channel Link: Stylecrazefitness"}}},{"startIndex":1484,"length":19,"onTap":{"innertubeCommand":
